import "./mine.css";
import Tips from "./components/tips/tip";

function mine(props){
    return(
    <div className="mine-bg">
        <div id="self-info">
            <div id="avatar"></div>
            <div id="self-intro">张天弋<p id="stu-num">2022214959</p></div>
            <div id="more-info">详情</div>
            <div id="arrow"></div>
        </div>
        <div id="morefunc">
        {props.tipsData.map((tip) => (
            <Tips key={tip.id} image={tip.image} tip={tip.tip}/>
        ))}
        </div>
        </div>
    )
}
export default mine;
